- input: "TEXT\x1CC00114439\x1CTEXT-00001\x1C\x1CF3XA\x1CAt the time the June Monthly
    Report was filed, the Committee disclosed the payment to Thompson Signs as Generic
    Yard Signs based on the invoice received.  However, the Committee has since received
    further information from the vendor that the payment made on May 28th was an IE
    for CD03.  The Committee has amended this report to correctly disclose this information
    on Line 24.  Please note that the IE payment previously disclosed on this report
    was corrected and has been disclosed on the May Monthly Report.  Please note that
    employees of the Committee that spent less than 25% of their time on Federal Election
    Activity were paid on the Schedule H4 uniform split.  Expenditures listed on Line
    21B did NOT meet the definition of Federal Elections Activity. In addition, all
    fundraising, event, and related payments made during this period were Committee
    fundraising and not on behalf of a Federal Candidate.   Please also note that
    the payments to Newman Partners are based on a contractual set amount per month
    without regard to the percentage of funds raised.  Due to the contractual agreement,
    the FEC Reports Analysis Supervisor has ruled that the payments qualify as Admin
    instead Fundraising and may be reported on Schedule H4.\n"
